define('tracemon.connector.ripe-database',[
    "tracemon.env.config",
    "tracemon.lib.jquery-amd"
], function(config, $) {

    var RipeDatabaseConnector = function (env) {
        var contactsByAsn, $this, abuseContactByAsn;

        $this = this;
        contactsByAsn = {};
        abuseContactByAsn = {};

        this._translateWhois = function(data){
            var attributes, objects, item, autNum, techContacts, roleContacts;

            techContacts = {};
            roleContacts = {};
            try { // The format is terrible, no meaning at all
                objects = data["objects"]["object"];
                autNum = null;
                for (var n=0,length=objects.length; n<length; n++){
                    item = objects[n];
                    if (item["type"] == "aut-num"){
                        autNum = item;
                        break;
                    }
                }

                attributes = autNum["attributes"]["attribute"];
                if (autNum && attributes){
                    for (var n=0,length=attributes.length; n<length; n++){
                        item = attributes[n];
                        if (item["name"] == "tech-c"){
                            if (item["referenced-type"] == "role"){
                                roleContacts[item["value"]] = true;
                            } else {
                                techContacts[item["value"]] = true;
                            }
                        }
                    }
                }


            } catch(e){
                throw "RIPE Database REST Api changed format - please update the method _translateWhois accordingly";
            }


            return {
                techContacts : Object.keys(techContacts), // Unique values
                roleContacts: Object.keys(roleContacts)
            };
        };

        this._translateAbuseContact = function(data){
            var contacts, contactsOut;

            try {
                contacts = data["data"]["anti_abuse_contacts"]["abuse_c"];

                contactsOut = $.map(contacts, function(contact){
                    return {
                        email: contact.email,
                        type: "abuse_c"
                    };
                });

            } catch(e){
                throw "RIPEstat Abuse contact API changed - please update the method _translateAbuseContact accordingly";
            }

            return contactsOut;
        };

        this._translatePerson = function(data){
            var attributes, objects, item, personObject, name, email;

            try { // The format is terrible, no meaning at all
                objects = data["objects"]["object"];
                personObject = null;
                for (var n=0,length=objects.length; n<length; n++){
                    item = objects[n];
                    if (item["type"] == "person" || item["type"] == "role"){
                        personObject = item;
                        break;
                    }
                }

                attributes = personObject["attributes"]["attribute"];
                if (personObject && attributes){
                    for (var n=0,length=attributes.length; n<length; n++){
                        item = attributes[n];

                        if (item["name"] == "person"){
                            name = item["value"];
                        }

                        if (item["name"] == "e-mail"){
                            email = item["value"];
                        }

                        if (name && email) {
                            break; // We have everything we need, just stop now
                        }
                    }
                }

            } catch(e){
                console.log(data);
                throw "RIPE Database REST Api changed format - please update the method _translatePerson accordingly";
            }


            return [{
                name : name,
                email: email,
                type: "tech-c"
            }];
        };

        this._handleError = function(error, deferredCall) {
            if (error == 404){ // Convert to specific error
                error = 695;
            }
            deferredCall.reject(error);
        };

        this.getAutonomousSystemContacts = function(asn){
            var abuseQuery, deferredCall;

            deferredCall = $.Deferred();

            this._whoisRestQuery(asn)
                .done(function(data){
                    var queries;

                    if (data["error"]){
                        $this._handleError(data["error"], deferredCall);
                    } else {

                        data = $this._translateWhois(data);
                        queries = $.map(data.techContacts, $this._personRestQuery);
                        queries = queries.concat($.map(data.roleContacts, $this._roleRestQuery));

                        abuseQuery = $this._getAbuseContacts(asn); // Add abuse_c queries

                        queries.push(abuseQuery);


                        try {
                            $.when
                                .apply($, queries)
                                .then(function () {
                                    var personsLists, cleanResults, persons;

                                    cleanResults = $.map([].slice.call(arguments), function (item) {
                                        return item[0];
                                    });

                                    personsLists = $.map(cleanResults, function (data) {
                                        if (data && !data["error"]) {
                                            return (data["objects"]) ? $this._translatePerson(data) : $this._translateAbuseContact(data);
                                        } else {
                                            throw 695; // If empty is anyway a 404
                                        }

                                    })
                                        .filter(function (item) {
                                            return item != null;
                                        });

                                    persons = [].concat.apply([], personsLists); // Flatten the array of array
                                    deferredCall.resolve(persons);
                                }, function (error) {
                                    $this._handleError(error, deferredCall);
                                });

                        } catch (error){
                            $this._handleError(error, deferredCall);
                        }
                    }
                });


            return deferredCall.promise();
        };



        this._getAbuseContacts = function(asn){
            if (!abuseContactByAsn[asn]) {
                abuseContactByAsn[asn] = $.ajax({
                    dataType: "jsonp",
                    cache: false,
                    async: true,
                    timeout: config.ajaxTimeout,
                    url: config.dataAPIs.abuseContactRestApi,
                    data:{
                        resource: "AS" + asn
                    },
                    error: function () {
                        env.utils.observer.publish("error", {
                            type: "408",
                            message: config.errors["408"]
                        });
                    }
                });
            }

            return abuseContactByAsn[asn];
        };

        this._whoisRestQuery = function (asn) {

            if (!contactsByAsn[asn]) {
                contactsByAsn[asn] = $.ajax({
                    dataType: "jsonp",
                    cache: false,
                    async: true,
                    timeout: config.ajaxTimeout,
                    url: config.dataAPIs.ripeDatabase.whois.replace("0000", asn),
                    error: function () {
                        env.utils.observer.publish("error", {
                            type: "408",
                            message: config.errors["408"]
                        });
                    }
                });
            }

            return contactsByAsn[asn];
        };


        this._roleRestQuery = function (roleId) {
            return $.ajax({
                dataType: "jsonp",
                cache: false,
                async: true,
                timeout: config.ajaxTimeout,
                url: config.dataAPIs.ripeDatabase.role.replace("0000", roleId),
                error: function () {
                    env.utils.observer.publish("error", {
                        type: "408",
                        message: config.errors["408"]
                    });
                }
            });
        };

        this._personRestQuery = function (personId) {
            return $.ajax({
                dataType: "jsonp",
                cache: false,
                async: true,
                timeout: config.ajaxTimeout,
                url: config.dataAPIs.ripeDatabase.person.replace("0000", personId),
                error: function () {
                    env.utils.observer.publish("error", {
                        type: "408",
                        message: config.errors["408"]
                    });
                }
            });
        };

    };

    return RipeDatabaseConnector;

});


define('tracemon.connector.facade',[
    "tracemon.env.config",
    "tracemon.lib.jquery-amd",
    "tracemon.connector.translation",
    "tracemon.connector.persist-host",
    "tracemon.connector.log.persist",
    "tracemon.connector.ripe-database"
], function(config, $, TranslateConnector, PersistHostConnector, LogRestConnector, RipeDatabaseConnector) {
    var antiFloodTimerNewStatus;


    var ConnectorFacade = function (env) {
        var translateConnector, $this, cache, persitHostConnector, logConnector, ripeDatabaseConnector;

        $this = this;
        translateConnector = new TranslateConnector(env);
        persitHostConnector = new PersistHostConnector(env);
        ripeDatabaseConnector = new RipeDatabaseConnector(env);
        logConnector = new LogRestConnector(env);
        cache = {
            geoRequests: {},
            reversDns: {},
            asnLookup: {},
            triangulated: {}
        };


        if (env.sendErrors) {
            window.onerror = function (error, url, line) {
                $this.persistLog("document", error + " url: " + url + " line: " + line);
            };

            env.utils.observer.subscribe("error", function (error) {
                this.persistLog(error.type, error.message);
            }, this);

        }

        this._handleError = function(error){
            var message;

            message = config.errors[error] || error;
            if (error) {
                env.utils.observer.publish("error", {
                    type: error,
                    message: message
                });
            }
        };

        this.getRealTimeResults = function(measurement, filtering){
            filtering = filtering || {};
            filtering.stream_type = "result";
            filtering.buffering = "true";
            filtering.msm = measurement.id;
            translateConnector.getRealTimeResults(
                filtering,
                function(result){
                    measurement.addTraceroutes(result);
                    clearTimeout(antiFloodTimerNewStatus);
                    antiFloodTimerNewStatus = setTimeout(function(){
                        env.historyManager.getLastState();
                    }, config.eventGroupingAntiFlood);
                }.bind(this));
        };

        this.getMeasurementsResults = function(measurements, options){
            var deferredCall, deferredArray, resultsPromise, measurement;

            deferredCall = $.Deferred();
            deferredArray = [];

            for (var n=0,length=measurements.length; n<length; n++){
                measurement = measurements[n];

                resultsPromise = translateConnector
                    .getMeasurementResults(measurement, options);

                deferredArray.push(resultsPromise); // Get results
            }


            $.when
                .apply($, deferredArray)
                .then(function(){
                    var measurements, traceroutes;

                    measurements = [].slice.call(arguments);
                    traceroutes = $.map(measurements, function(measurement){ // Enrich the probes (e.g. check if they replied) NOTE: it's ASYNC
                        return measurement.getTraceroutes();
                    });

                    $this._enrichProbes(traceroutes, options.sources);

                    env.utils.observer.publish("model.history:new");
                    deferredCall.resolve(measurements);
                }, function(error){
                    $this._handleError(error);
                });

            return deferredCall.promise();
        };

        this.getSourceHosts = function () {
            var sourceHosts = translateConnector.getSourceHosts();
            return Object.keys(env.loadedSources)
                .map(function (probeId) {
                    return sourceHosts[probeId];
                }).filter(function (item) {
                    return item != null;
                });
        };

        this.getAutonomousSystem = function(ip){
            var deferredCall;

            if (!cache.asnLookup[ip]) {
                deferredCall = $.Deferred();

                translateConnector.getAutonomousSystem(ip)
                    .done(function (data) {

                        deferredCall.resolve(data);
                    })
                    .fail(function (error) {
                        $this._handleError(error);
                    });
                cache.asnLookup[ip] = deferredCall.promise();
            }

            return cache.asnLookup[ip];
        };

        this.getHostReverseDns = function(host) {
            var deferredCall;

            if (!cache.reversDns[host.ip]) {

                deferredCall = $.Deferred();
                if (host.isPrivate || !host.ip) {
                    deferredCall.resolve(null);
                } else if (host.reverseDns) {
                    deferredCall.resolve(host.reverseDns);
                } else {
                    translateConnector.getHostReverseDns(host)
                        .done(function (data) {
                            deferredCall.resolve(data);
                        })
                        .fail(function (error) {
                            $this._handleError(error);
                        });
                }
                cache.reversDns[host.ip] = deferredCall.promise();
            }

            return cache.reversDns[host.ip];
        };

        this.tryGeolocatingAgain = function (host) {
            if (!cache.triangulated[host.ip]){
                // Try to locate the ip in a couple of minutes (try only once)
                setTimeout(function () {
                    cache.triangulated[host.ip] = true; // try once
                    delete cache.geoRequests[host.ip];
                    $this.getGeolocation(host, true);
                }, config.retryGeolocationAfter);
            }
        };

        this.getGeolocation = function(host, force, body){
            var deferredCall;

            if (host.isPrivate || !host.ip){
                throw "501"; // Not possible to find a geolocation
            }

            if (!force && cache.geoRequests[host.ip]){
                return cache.geoRequests[host.ip];
            } else {

                deferredCall = $.Deferred();

                if (host.getLocation()) {
                    deferredCall.resolve(host.getLocation());
                } else {
                    translateConnector.getGeolocation(host, force, body)
                        .done(function (data) {
                            deferredCall.resolve(data);
                        })
                        .fail(function(error){
                            $this._handleError(error);
                        });
                }
                cache.geoRequests[host.ip] = deferredCall.promise();

                return cache.geoRequests[host.ip];
            }
        };

        this.getMeasurements = function(measurementIds){
            var deferredCall, measurementId, promises, deferredArray;

            deferredCall = $.Deferred();
            deferredArray = [];


            for (var n=0,length=measurementIds.length; n<length; n++) {
                measurementId = measurementIds[n];

                promises = translateConnector
                    .getMeasurementInfo(measurementId);

                deferredArray.push(promises);
            }

            $.when
                .apply($, deferredArray)
                .then(function(){
                    deferredCall.resolve([].slice.call(arguments));
                }, function(error){
                    $this._handleError(error);
                });



            return deferredCall.promise();
        };

        this.getHosts = function() {
            return translateConnector.getHosts();
        };

        this.getASes = function () {
            return translateConnector.getASes();
        };

        this.getProbeInfo = function(probeId){
            return translateConnector.getProbeInfo(probeId);
        };

        this._enrichProbes = function(traceroutes, probesList){
            var replyingProbes, probeIds;

            probeIds = $.map(traceroutes, function(traceroute){
                return traceroute.source.probeId;
            });
            replyingProbes = env.utils.arrayUnique(probeIds);

            // Check if all the probes are replying and mark them.
            for (var n=0,length=probesList.length; n<length; n++) {
                env.loadedSources[probesList[n]].empty = (replyingProbes.indexOf(probesList[n]) == -1);
            }

        };

        this.persistLog = function(type, log){
            var browserVersion;

            if (env.sendErrors) {
                browserVersion = env.utils.getBrowserVersion();
                logConnector.error(type, log + ' (browser: ' + browserVersion.name + ' ' + browserVersion.version.toString() + ')');
            }
        };

        this.getAutonomousSystemContacts = function (asObject) {
            return ripeDatabaseConnector.getAutonomousSystemContacts(asObject.id).fail($this._handleError);
        };

        this.persist = function() {
            var hosts, host, callsArray, deferredCall;


            deferredCall = $.Deferred();
            hosts = this.getHosts();
            callsArray = [];
            for (var n=0,length=hosts.length; n<length; n++) {
                host = hosts[n];

                if (host && !host.isPrivate && host.ip && host.dirty && host.getLocation()){
                    callsArray.push(persitHostConnector.persist(host));
                }
            }

            $.when
                .apply($, callsArray)
                .then(function(){

                    for (var n=0,length=hosts.length; n<length; n++) {
                        hosts[n].dirty = false;
                    }
                    deferredCall.resolve();
                }, function(error){
                    for (var n=0,length=hosts.length; n<length; n++) {
                        hosts[n].dirty = false;
                    }
                    deferredCall.reject();
                });

            return deferredCall.promise();
        };
        
        this.getSparseHost = function (ip) {
            return translateConnector.getSparseHost(ip);
        };

        env.utils.observer.subscribe("model.host:locating", this.tryGeolocatingAgain, this);
    };

    return ConnectorFacade;

});



